INSERT INTO "Cfop"("identifier", "denomination", "note") VALUES (6102, 'VENDA DE MERCADORIA ADQUIRIDA OU RECEBIDA DE TERCEIROS', 'CLASSIFICAM-SE NESTE CÓDIGO AS VENDAS DE MERCADORIAS ADQUIRIDAS OU RECEBIDAS DE TERCEIROS PARA INDUSTRIALIZAÇÃO OU COMERCIALIZAÇÃO, QUE NÃO TENHAM SIDO OBJETO DE QUALQUER PROCESSO INDUSTRIAL NO ESTABELECIMENTO. TAMBÉM SERÃO CLASSIFICADAS NESTE CÓDIGO AS VENDAS DE MERCADORIAS POR ESTABELECIMENTO COMERCIAL DE COOPERATIVA DESTINADAS A SEUS COOPERADOS OU ESTABELECIMENTO DE OUTRA COOPERATIVA.');
